import React from "react";
import {
  motion,
  motionValue,
  useTransform,
  useViewportScroll,
} from "framer-motion";
import Aos from "aos";
import "aos/dist/aos.css";
function Edu(props) {
  return (
    <motion.Section
      style={{
        paddingLeft: "38px",
        marginLeft: "38px",
      }}
      className="bg-light "
    >
      <motion.div className=" container bg-light ">
        <motion.figure className="text-center">
          <h2
            data-aos="fade-right"
            style={{
              paddingBottom: "40px",
            }}
            class="display-4"
          >
            Education
          </h2>
          <div class="accordion accordion-flush" id="accordionFlushExample">
            <div class="accordion-item bg-light">
              <h2 class="accordion-header" id="flush-headingOne">
                Bachelor's in Computer Science
              </h2>

              <div class="accordion-body">
                MSUM, Moorhead, MN, USA (Graduated May 2021)
              </div>
            </div>
          </div>
          <div class="accordion accordion-flush" id="accordionFlushExample">
            <div class="accordion-item bg-light">
              <h2 class="accordion-header" id="flush-headingOne">
                Diploma in Computer Information Technology
              </h2>

              <div class="accordion-body">
                National Technology Institute, Auckland, New Zealand (Graduated
                March 2012)
              </div>
            </div>
          </div>
        </motion.figure>
      </motion.div>
    </motion.Section>
  );
}

export default Edu;
